text:
 Actually sitewide CSS should work fine; no JavaScript required. Adding this line:
.page-Main_Page #t-cite {display: none}
 to MediaWiki:Monobook.css should accomplish it. Make an {{editprotected}} request on MediaWiki talk:Common.css if you want it –

The call actually needs to be:
if( !document.all ) {
importScript('User:AzaToth/twinkle.js');
}
and don't forget to force-reload or clear your cache in IE for it to take effect.

Whoops, I just found a fix from the awesome 
Add the following code to your boxboxtop (extra-css=clear:both;) so that it look something like this, and your code will be fixed: {{boxboxtop|List of Appropriate Userboxes|extra-css=clear:both;}}
I hope this helps everyone.

